        function buildSlotItem(imgURL) {
            return $('<li class="item" style="background-color: ' + listaCores[randomItemIndex(listaCores.length - 1)] + '"><div style="padding-top: 245px; font-size: 100px">' + imgURL + '</div></li>');
        }

        function buildSlotWheels($container, itemsArray) {
            $items = itemsArray.map(buildSlotItem);
            $container.append($items);
        }

        function randomItemIndex(max) {
            return Math.floor(Math.random() * Math.floor(max));
        }
		
		var contador = 0;
		
		function rodaRoda(){
			if (contador == 0)
			{
				contador = 1;
				spin();
			}
			else if (contador == 1)
			{
			    contador = 2;
				spin2();
			}
			else if (contador == 2)
			{
			    contador = 3;
				spin3();
			}
			else if (contador == 3)
			{
			    contador = 4;
				spin4();
			}
			else if (contador == 4)
			{
				contador = 5;
				spin5();
			}
			else if (contador == 5)
			{
			    contador = 6;
				spin6();
			}
			else if (contador == 6)
			{
			    contador = 7;
				spin7();
			}
			else if (contador == 7)
			{
			    contador = 8;
				spin8();
			}
			else if (contador == 8)
			{
			    contador = 9;
				spin9();
			}
			else if (contador == 9)
			{
			    contador = 0;
				spin10();
			}
		}
		
		function spin() {
            var leftWheelIndex = randomItemIndex(leftItems.length - 1);
			console.log(leftWheelIndex);
            var snd = new Audio("piao.mp3");
            snd.play();
            $leftWheel.animate({
                top: -leftWheelIndex * 600
            }, 43000, 'easeInOutQuart');

            setTimeout(function () { party.screen(); document.getElementById('btnRodaRoda').innerText = 'Sortear'; }, 55000);
        }

        function spin2() {
            var leftWheelIndex = randomItemIndex(leftItems.length - 1);
			console.log(leftWheelIndex);
            var snd = new Audio("piao.remix.mp3");
            snd.play();
            $leftWheel.animate({
                top: -leftWheelIndex * 600
            }, 42000, 'easeOutQuad');
